      context=\"0\" place_id=\"\" woeid=\"3473789\" geo_is_public=\"1\" geo_is_contact=\"0\"
      geo_is_friend=\"0\" geo_is_family=\"0\" media=\"photo\" media_status=\"ready\"
      url_sq=\"https://live.staticflickr.com/65535/53637011658_8609f5354f_s.jpg\"
      height_sq=\"75\" width_sq=\"75\" url_t=\"https://live.staticflickr.com/65535/53637011658_8609f5354f_t.jpg\"
      height_t=\"27\" width_t=\"100\" url_s=\"https://live.staticflickr.com/65535/53637011658_8609f5354f_m.jpg\"
      height_s=\"64\" width_s=\"240\" url_m=\"https://live.staticflickr.com/65535/53637011658_8609f5354f.jpg\"
      height_m=\"133\" width_m=\"500\" url_q=\"https://live.staticflickr.com/65535/53637011658_8609f5354f_q.jpg\"
      height_q=\"150\" width_q=\"150\" url_l=\"https://live.staticflickr.com/65535/53637011658_8609f5354f_b.jpg\"
      height_l=\"272\" width_l=\"1024\" pathalias=\"migrandadworabutcha\">\n\t\t<description>These
      old boats present an unusual scene and situation. Over a period of time the
      owners of these mostly foreign boats who owed money to the port authorities
      in Montevideo gave in and opted for the cheaper choice and simply abandoned
      their old boats in this area. As of 2019 there were approximately fifty of which
      forty had passed into government ownership. \n\nAs well as being considered
      an eyesore these boats are rusting hulks that in most cases carry fuel and therefore
      a pollution risk. The government has finally decided to do something about this
      situation and contracted with the dutch salvage firm Christophersen to re float
      all boats and have them towed to the port of Puntas de Sayago where they will
      be cut up. The going rate is US dollars 150,000 per boat. It seems that a small
      number have already been moved. \n\nSeveral photos have been stitched together
      here. </description>\n\t</photo>\n\t<photo id=\"53635487310\" owner=\"69468437@N04\"
      secret=\"67e2f90483\" server=\"65535\" farm=\"66\" title=\"Now try getting out
      of that parking spot.\" ispublic=\"1\" isfriend=\"0\" isfamily=\"0\" ownername=\"Chris
      Firth of Wakey.\" dateadded=\"1712402118\" license=\"0\" safety_level=\"0\"
