      height_t=\"68\" width_t=\"100\" url_s=\"https://live.staticflickr.com/65535/53635487310_67e2f90483_m.jpg\"
      height_s=\"163\" width_s=\"240\" url_m=\"https://live.staticflickr.com/65535/53635487310_67e2f90483.jpg\"
      height_m=\"339\" width_m=\"500\" url_q=\"https://live.staticflickr.com/65535/53635487310_67e2f90483_q.jpg\"
      height_q=\"150\" width_q=\"150\" url_l=\"https://live.staticflickr.com/65535/53635487310_67e2f90483_b.jpg\"
      height_l=\"694\" width_l=\"1024\" pathalias=\"migrandadworabutcha\">\n\t\t<description>Just
      after I took this photo the owner of this car returned and  was obviously somewhat
      frustrated with the predicament. How on earth could she get out of that parking
      space.\n\nWe never found out as we continued our walk along the seafront. Photographed
      by the promenade in Montevideo. \n\nWe have come across similar situations to
      this in Italy where city central parking space is often at a premium. It seems
      the Italians often park with their car out of gear so that it can be shoved
      backwards or forwards by anyone who is blocked in like this. </description>\n\t</photo>\n\t<photo
